import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import LogForm from './components/LogForm';
import LogDisplay from './components/LogDisplay';
import MapComponent from './components/MapComponent';
import NotFound from './components/NotFound';
import './styles/App.css'; // Ensure you have an App.css file for styling

// Removed duplicate declaration of LogForm
//const LogDisplay = React.lazy(() => import('./components/LogDisplay'));
//const MapComponent = React.lazy(() => import('./components/MapComponent'));
//const NotFound = React.lazy(() => import('./components/NotFound'));

function App() {
  return (
    <BrowserRouter>
      <Header />
      <ErrorBoundary>
        <main className="App">
          <React.Suspense fallback={<div>Loading...</div>}>
            <Routes>
              <Route path="/" element={<LogForm />} />
              <Route path="/logs" element={<LogDisplay />} />
              <Route path="/map" element={<MapComponent />} />
              <Route path="*" element={<NotFound />} />
            </Routes>
          </React.Suspense>
        </main>
      </ErrorBoundary>
      <Footer />
    </BrowserRouter>
  );
}

export { App };
//export default React.memo(App);export default React.memo(App);
